import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './Screens/Home';
import Daily from './Screens/Daily';
import Earn from './Screens/Earn';
import Referrals from './Screens/Referrals';
import Airdrops from './Screens/Airdrops';
import BottomNavigation from './components/BottomNavigation';
import { useEffect, useState } from 'react';

function App() {
  const [webApp, setWebApp] = useState(null)

  useEffect(() => {
    const tg = window.Telegram.WebApp;
    tg.ready();

    if (tg?.initDataUnsafe?.user?.id) {
      const userId = tg.initDataUnsafe.user.id;
      const userIdString = userId.toString();

      setWebApp({
        id: userIdString, 
        firstName: tg?.initDataUnsafe?.user?.first_name,
        lastName: tg?.initDataUnsafe?.user?.last_name,
        username: tg?.initDataUnsafe?.user?.username,
        isBot: tg?.initDataUnsafe?.user?.is_bot,
        isPremium: tg?.initDataUnsafe?.user?.is_premium,
        languageCode: tg?.initDataUnsafe?.language_code,
      });

      tg.expand();
      tg.setBackgroundColor("#0b0b0b");
      tg.setHeaderColor("#0b0b0b");
    }
    else {
      setWebApp({
        id: "82424881123",
        firstName: "FirstName",
        lastName: null,
        username: "@username",
        languageCode: "en",
      });
    }
  },[]);

  return (
   <Router>
    <BottomNavigation />
    <Routes>
      <Route path='/' element={<Home/>} />
      <Route path='/' element={<Daily/>} />
      <Route path='/' element={<Earn/>} />
      <Route path='/' element={<Referrals/>} />
      <Route path='/' element={<Airdrops/>} />
    </Routes>
   </Router>
  );
}

export default App;
